  JWOODS, Marianne Sybil and SMITH, John Rhys Baxter
  01> SMITH, Andrew Simon Maxwell
  b 15.12.1968
  Andrew b. at Timaru. Address: 4/ 34 Rockley Road, South Yarra, Melbourne, Australia.
  Andrew was educated at Balclutha Primary School and John McGlashan College, Dunedin (1982),
  where he was captain of the 1st XV and played for the 1st XI. He held various positions with
  Trust Bank Otago before joining the Taranaki Savings Bank as a supervisor in their Computer
  Systems Department. In 1991 he moved to Melbourne where he is now employed with Oz Lite,
  Camberwell as a sales representative. Andrew has been involved with New Zealand Board Sailing
  as a competitor and an administrator.
  02> SMITH, Jacqueline Marianne m on **.01.1997 to MACLEAN, Mark
  (Jacqui)
  b 13.08.1970
  b ** ** ****
  Jacqui b. at Milton.
  Jacqui was educated at Balclutha Primary School and St Joseph's School, Oamaru. Her five years
  secondary education was completed at St Kevin's College, Oamaru in 1988. Whilst there she was a
  member of the Senior Netball Team for four years and captained the team for two years. She
  represented North Otago at all age levels in netball and in 1988 was a member of the North
  Otago Senior Netball Team which competed at the New Zealand National Netball Tournament. In
  1988 she was awarded the Senior Application and Participation Award at St Kevin's College. In
  1989 Jacqui represented North Otago in the National Top Town Teams Event in which Oamaru
  finished fifth overall. Since 1989 she has been studying for a BA in Geography at Otago
  University.
  05> WOODS, Sarah Elizabeth m on 01.09.1990 to RUTHERFORD, Gordon Alexander
  b 16.01.1949
  b 27.09.1954
  Sarah b. at Southport, England and m, at St Anne's Church, Northland, Wellington. Gordon, slo Jim
  Rutherford and Joyce Evans, b. at Seddon, Marlborough. Address: 15 Sydenham Street, Northland,
  Wellington 5.
  Sarah came to New Zealand with her parents in 1955. She was educated at St Margaret's College,
  Christchurch (Prefect, Dux 1965); Canterbury University (BA, 1968; MA with 1st Class Hons in
  History, 1972); Christchurch Secondary Teachers' College (Diploma with Distinction, 1973). She was
  a teacher at Wellington East Girls' College (1974-75); assistant advisory officer with the
  Department of Internal Affairs, Wellington (1976-77); manuscripts assistant at the Alexander
  Turnbull Library, Wellington (1977-79); assistant editor in the School Publications Branch of the
  Department of Education, Wellington (1979-81); teacher and course writer of English with the
  Correspondence School, Wellington (1982-). Her interests include singing (Royal Christchurch
  Musical Society, Bach and Orpheus Choirs, Wellington), drawing and gardening.
  Gordon was educated at Seddon School and Marlborough Boys' College. He was a bank officer in Seddon
  (1972-74); with the Ministry of Defence, Wellington (1976-85, 1987-89); on assignment to Vanuatu
  with Volunteer Service Abroad (1985-86); a computer consultant/ bank officer with Westpac Bank
  (1989-95); administration officer with Centurion Ltd (1995-98); and administration officer with
  Capital Health (1998-), Gordon's interests include singing, cooking and reading.
  02>'WILLIAMS, Olive Gaster
  b 18.05.1884 d 23.05.1975
  Olive b. at Gisborne and d. at Napier.
  Olive moved to Putiki/Wanganui with her parents in 1885. She learnt to speak fluent Maori and after leaving
  school she helped her parents with the Christian education of Maori children. She moved to Wanganui with
  her parents and continued to care for them until their deaths. Some years later she sold the house and
  moved to Napier where for many years she worked long hours caring for the babies and toddlers in St Mary's
  (cont...).
